/*Table structure for table `business_order` */

DROP TABLE IF EXISTS `business_order`;

CREATE TABLE `business_order` (
  `business_no` varchar(32) NOT NULL COMMENT '订单编号',
  `order_info` varchar(256) DEFAULT NULL COMMENT '订单内容',
  `member_id` varchar(32) DEFAULT NULL COMMENT '会员id',
  `order_sum` int(24) DEFAULT NULL COMMENT '订单金额',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `evaluate` varchar(256) DEFAULT NULL COMMENT '评价',
  `pay_type` int(22) DEFAULT NULL COMMENT '支付方式(1:银联 2：微信 3：支付宝)',
  `status` int(22) DEFAULT NULL COMMENT '状态（1：已支付 2：未支付）',
  PRIMARY KEY (`business_no`),
  KEY `cc` (`member_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

