/*Table structure for table `member` */

DROP TABLE IF EXISTS `member`;

CREATE TABLE `member` (
  `id` varchar(32) NOT NULL COMMENT '会员id',
  `name` varchar(16) DEFAULT NULL COMMENT '会员名称',
  `gender` int(22) DEFAULT NULL COMMENT '性别（1：男 2：女）',
  `cellphone` varchar(16) DEFAULT NULL COMMENT '手机号',
  `head_img` varchar(64) DEFAULT NULL COMMENT '头像',
  `password` varchar(128) DEFAULT NULL COMMENT '密码',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `email` varchar(128) DEFAULT NULL COMMENT '邮箱',
  `region` varchar(32) DEFAULT NULL COMMENT '地区',
  `order_num` int(24) DEFAULT NULL COMMENT '购买订单数',
  `order_sum` int(24) DEFAULT NULL COMMENT '消费金额',
  `status` int(22) DEFAULT NULL COMMENT '状态（1：已登录 2：未登录）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

